const e="Najczęściej zadawane pytania",o="Znajdźcie odpowiedzi na najważniejsze pytania dotyczące sesji fotograficznych",s=[{question:"Jak długo trwa sesja fotograficzna?",answer:"Czas trwania sesji zależy od jej rodzaju: sesje rodzinne trwają 1-2 godziny, sesje ciążowe około 1 godziny, a sesje noworodkowe 2-3 godziny (ze względu na potrzeby maluszka)."},{question:"Kiedy otrzymam zdjęcia po sesji?",answer:"Zdjęcia są gotowe w ciągu 2-3 tygodni od sesji. Otrzymacie galerię online z obrobionymi zdjęciami w wysokiej rozdzielczości, które możecie pobrać i wydrukować."},{question:"Ile zdjęć otrzymam po sesji?",answer:"Liczba zdjęć zależy od rodzaju sesji: sesje rodzinne - do 50 zdjęć, sesje noworodkowe - do 40 zdjęć, sesje ciążowe - do 30 zdjęć. Wszystkie zdjęcia są profesjonalnie obrobione."},{question:"Czy mogę wybrać lokalizację sesji?",answer:"Oczywiście! Mogę przyjść do Was do domu, wybrać się na plener (park, plaża, las) lub skorzystać ze studia. Razem znajdziemy najlepsze miejsce dla Waszej sesji."},{question:"Co jeśli pogoda nie będzie sprzyjać sesji plenerowej?",answer:"Zawsze mam plan B! Możemy przełożyć sesję na inny termin lub wybrać lokalizację pod dachem. Wasza wygoda i bezpieczeństwo są najważniejsze."},{question:"Czy potrzebuję specjalnych przygotowań do sesji?",answer:"Przed każdą sesją otrzymacie ode mnie szczegółowy przewodnik z porady dotyczącymi ubioru, przygotowań i tego, czego możecie się spodziewać. Wszystko wyjaśnię podczas konsultacji."},{question:"Czy współpracujesz z wizażystkami?",answer:"Tak, mogę polecić sprawdzone wizażystki, z którymi często współpracuję. Dla sesji ciążowych i rodzinnych profesjonalny makijaż może być pięknym dodatkiem."},{question:"Jakie są koszty sesji?",answer:"Ceny sesji zaczynają się od 400 zł (sesje ciążowe), przez 450 zł (sesje rodzinne), do 550 zł (sesje noworodkowe). Dokładną wycenę otrzymacie po omówieniu szczegółów sesji."}],i={sectionTitle:e,sectionDescription:o,faqs:s};export{i as default,s as faqs,o as sectionDescription,e as sectionTitle};
